import React from 'react';

const Header = () => {
    return (
        <h2 style={{
            fontSize: '1.6rem',
            textTransform: 'uppercase',
            fontWeight: 'bold',
            color: '#e4e4e4',
            letterSpacing: -3
        }}>My Tasks</h2>
    );
}
 
export default Header;
